import { Component } from 'react';
// import { Game } from './components/game/game.component';
import './App.css';

var Ball = {
  position_x: 50,
  position_y: 50,
  vel_x: 10,
  vel_y: 10

}
let ball = Ball;
setInterval(function(){
  ball.position_x = ball.position_x + ball.vel_x;
  ball.position_y = ball.position_y + ball.vel_y;
}, 6000);

class Game extends Component {

  componentDidMount() {
    console.log('CDM');
    // let canvas =  document.createElement('canvas');
    let canvas = document.getElementById('forCanvas');
    let ctx = canvas.getContext('2d');
    let width = 800;
    let height = 600;
    let ball = Ball;
    ctx.fillStyle = "black";
    ctx.fillRect(0, 0, width,  height);
    ctx.fillStyle = "white";
    ctx.fillRect(ball.position_x, ball.position_y, 10 , 10);
    ctx.beginPath();
  }

  render() {
    console.log('render');
    return(
      <div>
        <canvas id="forCanvas"></canvas>
      </div>
    );
  }
}

class App extends Component
{
  // constructor()  {

  // }

  render(){

    return (
    <div className="App">
      <h1>Pong</h1>
        <Game/>
  </div>
  );
  }
}


export default App;
